import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

export const Navigationhome = (props) => {
  const Nav = useNavigate();
  const Getlogout = () => {
    Nav('/logout');
  };

  const [data, setData] = useState({});

  useEffect(() => {
    axios.get(`http://localhost:5000/getdata/${window.localStorage.getItem('user')}`)
      .then((res) => {
        setData({ profile: res.data.profile });
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <nav id="menu" className="navbar navbar-default navbar-fixed-top">
      <div className="container">
        <div className="navbar-header">
          <a className="navbar-brand page-scroll" href="#page-top" id="navigationmain">
            <img src="http://localhost:5000/img/nav_icon.jpg" alt="astec logo"/>
            <h1>ASTEC</h1>
          </a>{" "}
          <button
            type="button"
            className="navbar-toggle collapsed"
            data-toggle="collapse"
            data-target="#bs-example-navbar-collapse-1"
          >
            {" "}
            <span className="sr-only">Toggle navigation</span>{" "}
            <span className="icon-bar"></span>{" "}
            <span className="icon-bar"></span>{" "}
            <span className="icon-bar"></span>{" "}
          </button>
        </div>

        <div
          className="collapse navbar-collapse"
          id="bs-example-navbar-collapse-1"
        >
          <ul className="nav navbar-nav navbar-right">
            <li>
              <a href="#features" className="page-scroll">
                Events
              </a>
            </li>
            {/* Other list items... */}
            <li>
              <div className="dropdown">
                <img src={`http://localhost:5000/profile/${data.profile}`} id="profileimg" className="dropdown-toggle" type="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false"/>
                <div className="dropdown-menu" aria-labelledby="dropdownMenuButton" style={{textAlign:'center',padding:'20px'}}>
                  <img src={`http://localhost:5000/profile/${data.profile}`} id="profilesubimg"/>
                  <h3>{window.localStorage.getItem('fname')} {window.localStorage.getItem('lname')}</h3>
                  <a className="dropdown-item" id="profilebtn" href="#" onClick={Getlogout}>LOGOUT</a>
                </div>
              </div>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};
